#![allow(non_snake_case, unused_macros)]
use proconio::input;
use rand::prelude::*;
use svg::node::element::{Circle, Definitions, Group, Image, Line, Style, Use};
use web_sys::console::log_1;

#[derive(Clone, Debug)]
pub struct Input {
    pub n: usize,
    pub m: usize,
    pub a: Vec<usize>,
    pub b: Vec<usize>,
}

impl std::fmt::Display for Input {
    fn fmt(&self, f: &mut std::fmt::Formatter<'_>) -> std::fmt::Result {
        writeln!(f, "{} {}", self.n, self.m)?;
        for i in 0..self.n {
            writeln!(f, "{} {}", self.a[i], self.b[i])?;
        }
        Ok(())
    }
}

pub fn parse_input(f: &str) -> Input {
    let f = proconio::source::once::OnceSource::from(f);
    input! {
        from f,
        n:usize,
        m: usize,
        abs: [(usize, usize); n]
    }
    let a = abs.iter().map(|(a, _)| *a).collect::<Vec<_>>();
    let b = abs.iter().map(|(_, b)| *b).collect::<Vec<_>>();
    Input { n, m, a, b }
}

pub struct Output {
    pub c: Vec<usize>,
    pub d: Vec<usize>,
    pub v: usize,
    pub t: Vec<usize>,
    pub r: Vec<usize>,
}

pub fn parse_output(f: &str, m: usize) -> Output {
    let f = proconio::source::once::OnceSource::from(f);
    input! {
        from f,
        cd: [(usize, usize); m],
        v: usize,
        tr: [(usize, usize); v]
    }
    let c = cd.iter().map(|(c, _)| *c).collect::<Vec<_>>();
    let d = cd.iter().map(|(_, d)| *d).collect::<Vec<_>>();
    let t = tr.iter().map(|(t, _)| *t).collect::<Vec<_>>();
    let r = tr.iter().map(|(_, r)| *r).collect::<Vec<_>>();
    Output { c, d, v, t, r }
}

pub fn gen(seed: u64) -> Input {
    let mut rng = rand_chacha::ChaCha20Rng::seed_from_u64(seed);

    let mut uv: Vec<(usize, usize)> = vec![];
    while uv.len() < 15 {
        let u = rng.gen_range(100, 901);
        let v = rng.gen_range(100, 901);

        let mut flag = 0;
        for (uval, vval) in uv.iter() {
            // ユークリッド距離を計算する
            let dx = (*uval as i32 - u as i32).abs();
            let dy = (*vval as i32 - v as i32).abs();
            let dist = (dx * dx + dy * dy) as f64;
            if dist < 100. * 100. {
                flag = 1;
                break;
            }
        }
        if flag == 1 {
            continue;
        }
        uv.push((u, v));
    }

    let mut xy: Vec<(usize, usize)> = vec![];
    for i in 0..100 {
        let base = rng.gen_range(0, 15);
        let x = uv[base].0 + rng.gen_range(0, 201) - 100;
        let y = uv[base].1 + rng.gen_range(0, 201) - 100;
        xy.push((x, y));
    }

    let a = xy.iter().map(|(x, _)| *x).collect::<Vec<_>>();
    let b = xy.iter().map(|(_, y)| *y).collect::<Vec<_>>();
    Input { n: 100, m: 8, a, b }
}

fn get_pos(input: &Input, output: &Output, turn: usize) -> (usize, usize) {
    if output.t[turn] == 1 {
        // 惑星の場所を返す
        return (input.a[output.r[turn] - 1], input.b[output.r[turn] - 1]);
    } else {
        // 宇宙ステーションの場所を返す
        return (output.c[output.r[turn] - 1], output.d[output.r[turn] - 1]);
    }
}

fn calculate_score(input: &Input, output: &Output) -> i64 {
    let mut result: f64 = 0.;

    let vv = output.v;
    for i in 0..(output.v - 1) {
        let base1 = output.t[i];
        let base2 = output.t[i + 1];
        let mut coeff = 1;
        if base1 == 1 && base2 == 1 {
            // 両方とも惑星
            coeff = 25;
        } else if (base1 == 1 && base2 == 2) || (base1 == 2 && base2 == 1) {
            coeff = 5;
        } else if base1 == 2 && base2 == 2 {
            coeff = 1;
        };
        let (x1, y1) = get_pos(input, output, i);
        let (x2, y2) = get_pos(input, output, i + 1);
        let euclid = ((x1 as i32 - x2 as i32).pow(2) + (y1 as i32 - y2 as i32).pow(2)) as i32;
        result += (euclid * coeff) as f64;
    }
    // log_1(&format!("result: {}, v:{}", result, output.v).into());

    let mut ret = 1000 * 1000 * 1000 / (1000 as f64 + (result as f64).powf(0.5)) as i64;
    return ret;

    // return ((10.).powf(9) / (1000 + (result as f64).powf(0.5))) as usize;
}

fn generate_dark_color(code: usize) -> String {
    // 入力値に基づいてHue（色相）を計算
    let hue = (code as f32 * 36.0) % 360.0;

    // Saturation（彩度）を低めに、Lightness（明度）を固定値で低く設定
    let saturation = 30.0;
    let lightness = 30.0;

    // HSL to RGB 変換
    let hue_normalized = hue / 360.0;
    let q = if lightness < 0.5 {
        lightness * (1.0 + saturation)
    } else {
        lightness + saturation - (lightness * saturation)
    };

    let p = 2.0 * lightness - q;

    let r = hue_to_rgb(p, q, hue_normalized + 1.0 / 3.0);
    let g = hue_to_rgb(p, q, hue_normalized);
    let b = hue_to_rgb(p, q, hue_normalized - 1.0 / 3.0);

    // RGB を 16 進数に変換して文字列を返す
    format!(
        "#{:02X}{:02X}{:02X}",
        (r * 255.0) as u8,
        (g * 255.0) as u8,
        (b * 255.0) as u8
    )
}

fn generate_color(code: usize) -> String {
    // 入力値に基づいてHue（色相）を計算
    let hue = (code as f32 * 36.0) % 360.0;

    // Saturation（彩度）とLightness（明度）を固定値で設定
    let saturation = 10.0;
    let lightness = 0.1;

    // HSL to RGB 変換
    let hue_normalized = hue / 360.0;
    let q = if lightness < 0.5 {
        lightness * (1.0 + saturation)
    } else {
        lightness + saturation - (lightness * saturation)
    };

    let p = 2.0 * lightness - q;

    let r = hue_to_rgb(p, q, hue_normalized + 1.0 / 3.0);
    let g = hue_to_rgb(p, q, hue_normalized);
    let b = hue_to_rgb(p, q, hue_normalized - 1.0 / 3.0);

    // RGB を 16 進数に変換して文字列を返す
    format!(
        "#{:02X}{:02X}{:02X}",
        (r * 255.0) as u8,
        (g * 255.0) as u8,
        (b * 255.0) as u8
    )
}

fn hue_to_rgb(p: f32, q: f32, t: f32) -> f32 {
    let t = if t < 0.0 {
        t + 1.0
    } else if t > 1.0 {
        t - 1.0
    } else {
        t
    };

    if t < 1.0 / 6.0 {
        p + (q - p) * 6.0 * t
    } else if t < 1.0 / 2.0 {
        q
    } else if t < 2.0 / 3.0 {
        p + (q - p) * (2.0 / 3.0 - t) * 6.0
    } else {
        p
    }
}

pub fn vis(input: &Input, output: &Output, turn: usize) -> (i64, String, String) {
    let IMAGE = "data:image/png;base64,";
    let score = calculate_score(input, output);

    let W = 1000;
    let H = 1000;
    let mut doc = svg::Document::new()
        .set("id", "vis")
        .set("viewBox", (-5, -5, W + 10, H + 10))
        .set("width", W + 10)
        .set("height", H + 10)
        .set("style", "background-color:white");

    doc = doc.add(
        Definitions::new().add(
            Image::new()
                .set("id", "robo")
                .set("width", 100)
                .set("height", 100)
                .set("preserveAspectRatio", "none")
                .set("href", IMAGE),
        ),
    );

    doc = doc.add(Style::new(format!(
        "text {{text-anchor: middle;dominant-baseline: central; font-size: {}}}",
        6
    )));

    for i in 0..input.n {
        doc = doc.add(
            Circle::new()
                .set("cx", input.a[i])
                .set("cy", input.b[i])
                .set("r", 8)
                .set("fill", "#ffff00")
                .set("stroke", "black")
                .set("stroke-width", 1)
                .set("class", "box"),
        );
    }
    for i in 0..input.m {
        doc = doc.add(
            Circle::new()
                .set("cx", output.c[i])
                .set("cy", output.d[i])
                .set("r", 10)
                .set("fill", "#ff0000")
                .set("stroke", "black")
                .set("stroke-width", 1)
                .set("class", "box"),
        );
    }

    for i in 0..(output.v - 1) {
        let (x1, y1) = get_pos(input, output, i);
        let (x2, y2) = get_pos(input, output, i + 1);

        doc = doc.add(
            Line::new()
                .set("x1", x1)
                .set("y1", y1)
                .set("x2", x2)
                .set("y2", y2)
                .set("stroke", "#000000"),
        );
    }

    // 現在の場所にロケットの画像を埋め込む
    let (x, y) = get_pos(input, output, turn);
    doc = doc.add(Group::new().add(Use::new().set("x", x).set("y", y).set("href", "#robo")));
    (score as i64, "".to_string(), doc.to_string())
}
